import React from "react";
import styled from "styled-components";

const StyleCulcolator = styled.div`
    background-color: #718792;
    width: 400px;
    height: 600px;
    margin: auto;
    margin-top: 150px;
    border-radius: 10px;
`;

const Display = styled.div`
    width: 330px;
    height: 60px;
    background-color: #eceff1;
    border-radius: 10px;
    margin: auto;
    margin-top: 20px;
    padding: 20px;
`;

const Keyboard = styled.div`
    width: 360px;
    height: 470px;
    background-color: #90a4ae;
    margin: auto;
    margin-top: 50px;
`;
const Culcolator = () => {
    return (
        <>
            <StyleCulcolator>
                <Display></Display>

                <Keyboard></Keyboard>
            </StyleCulcolator>
        </>
    );
};

export default Culcolator;
